import { LineOne, Logo, MenuIcon, Nav } from "../styles/layout/Nav.styled";

export const NavBar = () => {
  return (
    <>
      <Nav>
        <div>
          <a href="#hero-section">
            <Logo src="./images/logo.jpg" />
          </a>
        </div>
        <MenuIcon>
          <LineOne />
        </MenuIcon>
        <div>Nav List</div>
      </Nav>
    </>
  );
};
